<?phpnamespace Unit;class TestResult{    private $fnName;    private $performance;    private $status;    private $result;        public function __construct($fnName, $result, $performance, $status)    {        $this->fnName = $fnName;        $this->performance = $performance;        $this->result = $result;        $this->status = $status;    }        public function getFnName()    {        return $this->fnName;    }        public function getPerformance()    {        return $this->performance;    }        public function getStatus()    {        return $this->status;    }        public function getResult()    {        return $this->result;    }        public function compareEff(TestResult $base)    {        $eff = round((($base->getPerformance() - $this->performance) / $base->getPerformance()) * 100, 4);        return $eff;    }}